Let's design a computational model to predict responder acceptance behavior in this economic game.

**Step 1: Key Psychological Mechanisms**

Responders likely consider several factors:

* **Fairness:**  How does the proposed split compare to the perceived fairness given the relative contributions (token_self vs. token_opp)? A simple difference isn't sufficient because fairness is relative to the total earnings.
* **Self-interest:** How much money will the responder receive (split_self)?
* **Relative gains:**  Did the opponent receive a disproportionately large share compared to their contribution? This could evoke spiteful rejection even if the responder's share is good.
* **Risk aversion/seeking:** Responders might be more willing to accept lower offers if the potential loss of rejecting a small offer is greater than the potential gain of rejecting a larger offer.

**Step 2: Interaction of Mechanisms**

Fairness and self-interest are likely intertwined. A responder might accept an unfair offer if their share is still substantial.  Relative gains can modify the impact of fairness; an extremely unfair offer might be rejected even if the responder's share is high. Risk aversion or seeking is another modulatory factor. Risk-averse players would accept smaller shares compared to risk seekers

**Step 3: Mathematical Form**

A logistic regression model can capture the binary choice of acceptance/rejection. We can build a utility function based on the variables above, and then map that utility to a probability using a logistic function.

**Step 4: Parameters**

To capture the complex interactions, we'll incorporate several learnable parameters that weigh the influence of each factor, instead of using only relative gain or fairness.


**Step 5: Mapping to Observable Behavior**

The model's output, the probability of acceptance, is directly comparable to the observed "accept" variable in the dataset.


